“Do you play tennis? “
“No, why would you ask..”
@asherdeva giving me an excuse to shoot (and post) film (and digital).

@katemoorephoto I knew then. Nine years ago I asked you to meet up so we could talk about photography and compare notes on our seemingly endless amount of cross country road trips. Secretly though, I wanted to meet up because I was a  fan of your incredible photography and I wanted to learn your photoshop process.  Imagine my surprise when you said your process was just to make adjustments until you found something you liked and then start all over again at the next set of images. I was floored. FLOORED. 

The last eight years have been a blessing which I never expected nor felt I deserved. You’re my best friend, my inspiration, my partner, Olive’s Mama, and It’s been my honor to stand by your side through all the ups and downs of life. I cannot wait to start this next chapter together. Love you forever.
PS - you still have rice and guac in your hair.

Thursday or Friday. 
